 //  Search Function Starts \n   pagesList = false;\n   click_in() {\n    this.pagesList = true;\n  }\n   onClickedOutside(e: Event) {\n    this.pagesList = false;\n  }\n   search(event) {\n    this.index.search({\n      query: this.searchQuery\n    }).then((data) => {\n      this.algoliaResults = data.hits;\n    })\n  }\n  //  Search Function Ends\n}\n    \n\n    \n        \n\n\n\n  \n  \n    \n      \n        \n          \n            GOVERNMENT PORTAL\n          \n        \n        \n          \n        \n      \n    \n    \n\n    \n\n    \n    WELCOME TO GOVERNMENT PORTAL\n    All government services at one place.\n    \n    \n      \n        {{ algoliaResult.name }}\n        \n      \n    \n  \n  \n\n  \n  \n    \n      Travel\n    \n    Background of Ministry of Tourism and Aviation \n    The Ministry of Tourism and Aviation was established on 10thDecember 2019 under the extraordinary gazette No.\n      2153/12. Among the main objectives of the establishment of a dedicated Ministry in charge of the tourism and\n      Aviation\n      sectors are making available an appropriate policy and regulatory framework, ensure robust infrastructure\n      development\n      and Aviation, promotion of destination Sri Lanka and exercise administrative and financial overview over\n      institutions\n      Gazetted under the Ministry.\n    \n    Duties and Functions\n    \n      Formulation, implementation, monitoring and evaluation of policies, programmes and projects; in relation to\n        the\n        subject of tourism and civil aviation and the subjects of the departments and statutory institutions.\n      Develop tourism industry and high standards in line with the national policy of promoting Sri Lankas image.\n      \n      Registration and regulation of tourist agencies\n      Promote internationally recognized hotel facilities, aviation and sea travel facilities to provide tourist\n        resorts\n        and entertainment facilities as a unique tourist island, highlighting Sri Lankas biodiversity, heritage,\n        environment, climate diversity and oceanic resources.\n      Developing and regulating International & Domestic Airports\n      Regulating progress, levy of charges and quality of delivery of services by airports\n      Conclusion of agreements with other countries for expansion of international air services and adoption of\n        other\n        requisite measures.\n      Promotion and execution of regulatory functions in relation to use of airports in Sri Lanka by foreign\n        countries.\n      \n      Promoting domestic air travel\n      Supervising and regulating private air services\n      Registration of Aircraft\n      Supervising all Institutions referred to in Column II and matters relating to all subjects assigned to such\n        Institutions.\n    \n    Vision\n    To be recognized as the worlds finest island for memorable, authentic and diverse experiences.\n    Mission\n    To be a high- value destination offering extraordinary experiences that reflect Sri Lankas natural and\n      cultural\n      heritage are socially inclusive and environmentally responsible and provide economic benefits to Communities and\n      the\n      country.\n    \n      Apply for your Travel and Tourism services through Government Portal\n    \n  \n  \n\n  \n\n  \n  \n    \n      \n        Government Portal\n        Ministry of Home Affairs\n      \n    \n  \n  \n\n    \n\n    \n                \n                    ./travel.page.scss\n                \n                #container {\n    text-align: center;\n  \n    position: absolute;\n    left: 0;\n    right: 0;\n    top: 50%;\n    transform: translateY(-50%);\n  }\n  \n  #container strong {\n    font-size: 20px;\n    line-height: 26px;\n  }\n  \n  #container p {\n    font-size: 16px;\n    line-height: 22px;\n  \n    color: #8c8c8c;\n  \n    margin: 0;\n  }\n  \n  #container a {\n    text-decoration: none;\n  }\n  \n  .underline {\n    text-decoration: underline;